import * as services from "../services/envanterServices";

import { useState, useEffect } from "react";

export default function EnvanterPage() {
  const [envanterList, setEnvanterList] = useState();

  useEffect(() => {
    if (!envanterList) {
      services.getEnvanter().then((res) => {setEnvanterList(res.data);console.log(res)});
    }
  }, [envanterList]);

  return (
    <table>
      <tr>
        <th>Envanter Seri No</th>
        <th>Envanter Tipi</th>
        <th>Envanter Markasi</th>
        <th>Envanter Modeli</th> 

      </tr>

      {envanterList?.map((item) => (
        <tr>
          <td>{item?.envanterSeriNo}</td>
          <td>{item?.envanterTipi}</td>
          <td>{item?.envanterMarkasi}</td>
          <td>{item?.envanterModel}</td> 


        </tr>
      ))}
    </table>
  );
}
